export async function loadTwinkleUpdater(engine, refresh = true) {
    await engine.addParticleUpdater("twinkle", async () => {
        const { TwinkleUpdater } = await import("./TwinkleUpdater.js");
        return new TwinkleUpdater();
    }, refresh);
}
